class Menu{
    title;
    color;
    icon;

    constructor(title, color, icon) {
        this.title = title;
        this.color = color;
        this.icon = icon;
    }
}

Vue.createApp({
    data() {
        let menu = [
            new Menu("Home","#D06503","data:image/png;base64,"),
            new Menu("Services","#E9931A","data:image/png;base64,"),
            new Menu("Portfolio","#1691BE","data:image/png;base64,"),
            new Menu("Blog","#166BA2","data:image/png;base64,"),
            new Menu("The team","#1B3647","data:image/png;base64,"),
            new Menu("Contact","#152836","data:image/png;base64,")
        ];
        let flag = false;
        //解决响应式的bug
        const search = () => {
            if (flag) {
                document.getElementById('cont').style.display = 'none';
            } else {
                document.getElementById('cont').style.display = 'flex';
            }
            flag = !flag;
        }
        window.onresize = function (e) {
            if (e.currentTarget.innerWidth > 599) {
                document.getElementById('cont').style.display = 'flex';
            } else {
                document.getElementById('cont').style.display = 'none';
            }
        }
        return{
            menu,search
        }
    }
}).mount("#app");